import React from "react";

type Props = {
  items: string[];
};

export const Todos = ({ items }: Props) => {
  return (
    <div>
      <ul>
        {items.map((item) => (
          <li key={item}>{item}</li>
        ))}
      </ul>
    </div>
  );
};
